The plus to updating to this release is that MKL will no longer be a hard dependency, so anyone with the usual BLAS will be able to R-CNN.

The [1.0 milestones](https://github.com/BVLC/caffe/issues?milestone=1&page=1&state=open) that might need further changes are weight sharing and consolidating the network definitions into a single prototxt. These won't exactly be done in a day, so you shouldn't have to turn around and change it again soon.

